css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix("http://origincheats.com/forum/") {
  
  html, body, p, code::before, table {
    margin: 0px;
    padding: 0px;
    font-family: Tahoma,Verdana,Arial,sans-serif;
    font-size: 14px;
    color: #fff;
  }
  
  body{
    background-color: #111;
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
    font-style: normal;
    background: #222;
  }
  .header{
    background: #555 url("http://origincheats.com/forum/images/axis/mainbg.png") repeat-x scroll 0% 0%;
    border-top: 1px solid #4ED165;
    border-bottom: 1px solid #4ED165;
    margin-bottom: 10px;
  }
  .enmenu{
    background: #222;
    border: 1px solid #4ED165;
  }
  
  #shoutbox{
    border: 1px solid #4ED165;
    color: #fff;
  }
  #shoutbox .panel .text{
    color: #fff;
    background-color: #222;
    border-top: 1px solid #4ED165;
    border-bottom: 1px solid #4ED165;
    height: 1.02cm;
  }
  
  .post .post_author div.author_statistics{
    color: #fff;
    background: #222;
    border: 1px solid #4ED165; 
  }
  .postbit_buttons > a:link, .postbit_buttons > a:hover, .postbit_buttons > a:visited, .postbit_buttons > a:active {
    cursor: pointer;
    background: #222 none repeat scroll 0% 0%;
    border-radius: 0px;
    border: 1px solid #4ED165;
  }
  
  .ensettings, .totop, #search input.button, html ul.tabs li.active, html ul.tabs li.active a:hover, ul.tabs li a:hover, postbit_buttons > a:link, .postbit_buttons > a:hover, .postbit_buttons > a:visited, .postbit_buttons > a:active, .pagination .pagination_current, .pagination a:hover{
    background: #111;
    border: 1px solid #4ED165;
    border-radius: 0px;
  }
  
  .welcomename, .fbstats, .socialicons ul li a, .advsearch, .search-link, .breadcrumb .crust:last-child a.crumb, .home, a:link, a:visited, .post .post_author div.author_statistics{
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
    font-style: normal;
    
  }
  
  .post .post_author, .post .post_controls{
    background-color: #333;
    border-top: 1px solid #4ED165;
    border-bottom: 1px solid #4ED165; 
  }
  .post{
    color: #fff;
    background-color: #222;
  }
  
  .fbstats{
    background: #222;
    border: 1px solid #4ED165;
    border-radius: 0px;
    color: #fff;
  }
  
  textarea{
    background-color: #333;
    color: #fff;
    border: 1px solid #4ED165;
    border-radius: 0px;
  }
  
  .panel{
    background: #333;
    border-top: 1px solid #4ED165;
    border-bottom: 1px solid #4ED165;
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
    font-style: normal; 
  }
  
  #container{
    background-color: #222;
    border-right: 1px solid #4ED165;
    border-left: 1px solid #4ED165;
    border-bottom: 1px solid #4ED165;
    margin-bottom: 10px;
    margin-top: 10px;
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
    font-style: normal;
  }
  #container .breadcrumb{
    background-color: #333;
    border-top: 1px solid #4ED165;
    border-bottom: 1px solid #4ED165;
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
    font-style: normal;
  }
   #container .breadcrumb .crumbs .crust .crumb{
     font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
     font-style: normal; 
   }
  
  #content tbody .trow2, .trow1, #content tbody{
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
    font-style: normal;
    color: #fff;
    background-color: #333;
    
  }
  .thead, .tfoot{
    background: #555 url("http://origincheats.com/forum/images/axis/mainbg.png") repeat-x scroll 0% 0%;
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
    font-style: normal;
    color: #fff;
    border-bottom: 1px solid #4ED165;
  }
  .tborder{
    background: #4ED156;
    border-radius: 0px;
  }
  .tcat{
    background: #444;
    border-bottom: 1px solid #4ED165;
    font-family: "source_sans_proregular",Tahoma,Verdana,Arial,sans-serif;
  }
  .trow1{
    border-bottom: 1px solid #4ED165;
    background: #222;
  }
  .trow2{
    border-: 1px solid #4ED165;
    border-bottom: 1px solid #4ED165;
    background: #333;
  }
  
  .tab_container{
    background-color: #333;
    border: none;
  }

}
